import React from 'react';
import {Component} from 'react';
import {connect} from 'react-redux';


class Chat extends Component{
  render(){
    return(
      <div class="dialogMessages">
        <div class="messageProfileInfo">
          <img src="../static/src/profilePhoto.jpg" alt="PHOTO"/>
          <h4>{this.props.interlocutor}</h4>
        </div>
        <p class='isOnline'>online</p>
        <div class="dialogBlock">
          <div class='yourMessage'><p>Мяу!</p> <span class='messageTime'>13:01</span></div>
          <div class='interlocutorMessage'><p>Мяу мяу..</p><span class='messageTime'>13:09</span></div>
          <div class='yourMessage'><p>мяу?</p><span class='messageTime'>13:10</span></div>
          <div class='yourMessage'><p>МЯУ</p><span class='messageTime'>13:10</span></div>
          <div class='interlocutorMessage'><p>Мяумяумяу</p><span class='messageTime'>13:11</span></div>
          <div class='interlocutorMessage'><p>Мяяяяяяяу</p><span class='messageTime'>13:32</span></div>
          <div class='yourMessage'><p>Мяу, мяу?</p><span class='messageTime'>13:33</span></div>
          <div class='interlocutorMessage'><p>Мяу.</p><span class='messageTime'>13:33</span></div>
          <div class='yourMessage'><p>Мяууу</p><span class='messageTime'>13:34</span></div>
          <div class='interlocutorMessage'><p>Мяу!</p><span class='messageTime'>13:35</span></div>
          <div class='interlocutorMessage'><p>Мяу!</p><span class='messageTime'>13:35</span></div>
          <div class='interlocutorMessage'><p>МЯУ!</p><span class='messageTime'>13:35</span></div>
          <div class='interlocutorMessage'><p>Гав!</p><span class='messageTime'>13:35</span></div>
          <div class='yourMessage'><p>0_0</p><span class='messageTime'>13:35</span></div>
          <div class='interlocutorMessage'><p>Мяу!</p><span class='messageTime'>13:35</span></div>
        </div>
        <input type="text" placeholder="Enter your message" class='messageInput'/>
      </div>
    )
  }
}

export default connect(
  state =>({
    interlocutor: state.dialog.interlocutor
  }),
  dispatch =>({})
)
